Fraser syndrome is diagnosed based on the signs and symptoms found in each individual. Many different researchers have proposed  diagnostic guidelines based on a certain number of symptoms considered to be major (or common) criteria and a certain number of symptoms considered to be minor (or less common) criteria. Although there is some debate regarding what is classified as major versus minor criteria, most researchers agree that a diagnosis is made based on the finding of 3 major criteria, or 2 major and 2 minor criteria, or 1 major and 3 minor criteria.[12723][12724][12725]<br />
<br />
Genetic testing may additionally be useful to confirm the diagnosis.&nbsp;
